import React, { Component } from 'react';
import Header from '../Header';
import StickyHeader from 'react-sticky-header';
import './index.css';

class Home extends Component {
	render() {
		return(
		<div>
			<StickyHeader
				header = {
					<Header />
				}
			>
			<section>
				<div className="home">
					<div>Hi =)</div>
					<div>Bye =)</div>
				</div>
			</section>
			</StickyHeader>
		</div>);
	}
}

export default Home;
